import React, { Component } from 'react';
import styled from 'styled-components';


const Container = styled.div`
  width: 600px;
`;

class TweetTimeline extends Component {
  render() {
    return (
      <Container>
        { this.props.children }
      </Container>
    )
  }
}

export default TweetTimeline;
